import { Component } from '@angular/core';

@Component({
  selector: 'app-root',
  template: `
  <h1>Hello World!</h1>
  <p>This template definition spans multiple lines.</p>
`,
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.css']
})
export class AppComponent {
  title = 'myapplication';
  name:string='Nitin sharma'
}
